import React, { Component } from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
import Login from '../login/login'
import waveup from '../../img/wave(1).svg'
import wavedown from '../../img/wave(2).svg'
import  './home.css';
import Header from './header.js';
export default class Home extends Component {
    render() {
        return (
            <Router>
                <Header/>
                    <div className="contentContainer">
                        <span className="title1">STRATEGIC HOSPITAL</span>
                        <span className="title2">MANAGEMENT SYSTEM</span>
                        <Link to="/login" exact>
                            <button class="button"><span>Login</span></button>
                        </Link>
                    </div>
                    <img className="upWave" src={waveup} alt="Up wave"/>               

                    <Switch>
                        <Route path="/login">
                            <Login/>
                        </Route>
                    </Switch>   
            </Router>        
        )
    }
}
